n Francisco to Buffalo with Minneapolis as the transfer point.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.461879062525E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"e2168a9e-bc28-4951-a381-cf1b18de6454"},{"version":"CommandV1","origId":105720,"guid":"d9474356-59bc-43ad-b5ea-37e68a31d62f","subtype":"command","commandType":"auto","position":44.0,"command":"%md \n## Loading the D3 Visualization\nUsing the airports D3 visualization to visualize airports and flight paths","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.461879062571E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"2117c13d-1bc2-4267-aa7f-1870ccbbf954"},{"version":"CommandV1","origId":105721,"guid":"c76307c0-53b1-45a5-ac5a-f8ef4d335b3c","subtype":"command","commandType":"auto","position":45.0,"command":"package d3a\n// We use a package object so that we can define top level classes like Edge that need to be used in other cells\n\nimport org.apache.spark.sql._\nimport com.databricks.backend.daemon.driver.EnhancedRDDFunctions.displayHTML\n\ncase class Edge(src: String, dest: String, count: Long)\n\ncase class Node(name: String)\ncase class Link(source: Int, target: Int, value: Long)\ncase class Graph(nodes: Seq[Node], links: Seq[Link])\n\nobject graphs {\nval sqlContext = SQLContext.getOrCreate(org.apache.spark.SparkContext.getOrCreate())\nimport sqlContext.implicits._\n\ndef force(clicks: Dataset[Edge], height: Int = 100, width: Int = 960): Unit = {\n  val data = clicks.collect()\n  val nodes = (data.map(_.src) ++ data.map(_.dest)).map(_.replaceAll(\"_\", \" \")).toSet.toSeq.map(Node)\n  val links = data.map { t =>\n    Link(nodes.indexWhere(_.name == t.src.replaceAll(\"_\", \" \")), nodes.indexWhere(_.name == t.dest.replaceAll(\"_\", \" \")), t.count / 20 + 1)\n  }\n  showGraph(height, width, Seq(Graph(nodes, links)).toDF().toJSON.first())\n}\n\n/**\n * Displays a force directed graph using d3\n * input: {\"nodes\": [{\"name\": \"...\"}], \"links\": [{\"source\": 1, \"target\": 2, \"value\": 0}]}\n */\ndef showGraph(height: Int, width: Int, graph: String): Unit = {\n\ndisplayHTML(s\"\"\"<!DOCTYPE html>\n<html>\n  <head>\n    <link type=\"text/css\" rel=\"stylesheet\" href=\"https://mbostock.github.io/d3/talk/20111116/style.css\"/>\n    <style type=\"text/css\">\n      #states path {\n        fill: #ccc;\n        stroke: #fff;\n      }\n\n      path.arc {\n        pointer-events: none;\n        fill: none;\n        stroke: #000;\n        display: none;\n      }\n\n      path.cell {\n        fill: none;\n        pointer-events: all;\n      }\n\n      circle {\n        fill: steelblue;\n        fill-opacity: .8;\n        stroke: #fff;\n      }\n\n      #cells.voronoi path.cell {\n        stroke: brown;\n      }\n\n      #cells g:hover path.arc {\n        display: inherit;\n      }\n    </style>\n  </head>\n  <body>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.js\"><\/script>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.csv.js\"><\/script>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.geo.js\"><\/script>\n    <script src=\"https://mbostock.github.io/d3/talk/20111116/d3/d3.geom.js\"><\/script>\n    <script>\n      var graph = $graph;\n      var w = $width;\n      var h = $height;\n\n      var linksByOrigin = {};\n      var countByAirport = {};\n      var locationByAirport = {};\n      var positions = [];\n\n      var projection = d3.geo.azimuthal()\n          .mode(\"equidistant\")\n          .origin([-98, 38])\n          .scale(1400)\n          .translate([640, 360]);\n\n      var path = d3.geo.path()\n          .projection(projection);\n\n      var svg = d3.select(\"body\")\n          .insert(\"svg:svg\", \"h2\")\n          .attr(\"width\", w)\n          .attr(\"height\", h);\n\n      var states = svg.append(\"svg:g\")\n          .attr(\"id\", \"states\");\n\n      var circles = svg.append(\"svg:g\")\n          .attr(\"id\", \"circles\");\n\n      var cells = svg.append(\"svg:g\")\n          .attr(\"id\", \"cells\");\n\n      var arc = d3.geo.greatArc()\n          .source(function(d) { return locationByAirport[d.source]; })\n          .target(function(d) { return locationByAirport[d.target]; });\n\n      d3.select(\"input[type=checkbox]\").on(\"change\", function() {\n        cells.classed(\"voronoi\", this.checked);\n      });\n\n      // Draw US map.\n      d3.json(\"https://mbostock.github.io/d3/talk/20111116/us-states.json\", function(collection) {\n        states.selectAll(\"path\")\n          .data(collection.features)\n          .enter().append(\"svg:path\")\n          .attr(\"d\", path);\n      });\n\n      // Parse links\n      graph.links.forEach(function(link) {\n        var origin = graph.nodes[link.source].name;\n        var destination = graph.nodes[link.target].name;\n\n        var links = linksByOrigin[origin] || (linksByOrigin[origin] = []);\n        links.push({ source: origin, target: destination });\n\n        countByAirport[origin] = (countByAirport[origin] || 0) + 1;\n        countByAirport[destination] = (countByAirport[destination] || 0) + 1;\n      });\n\n      d3.csv(\"https://mbostock.github.io/d3/talk/20111116/airports.csv\", function(data) {\n\n        // Build list of airports.\n        var airports = graph.nodes.map(function(node) {\n          return data.find(function(airport) {\n            if (airport.iata === node.name) {\n              var location = [+airport.longitude, +airport.latitude];\n              locationByAirport[airport.iata] = location;\n              positions.push(projection(location));\n\n              return true;\n            } else {\n              return false;\n            }\n          });\n        });\n\n        // Compute the Voronoi diagram of airports' projected positions.\n        var polygons = d3.geom.voronoi(positions);\n\n        var g = cells.selectAll(\"g\")\n            .data(airports)\n          .enter().append(\"svg:g\");\n\n        g.append(\"svg:path\")\n            .attr(\"class\", \"cell\")\n            .attr(\"d\", function(d, i) { return \"M\" + polygons[i].join(\"L\") + \"Z\"; })\n            .on(\"mouseover\", function(d, i) { d3.select(\"h2 span\").text(d.name); });\n\n        g.selectAll(\"path.arc\")\n            .data(function(d) { return linksByOrigin[d.iata] || []; })\n          .enter().append(\"svg:path\")\n            .attr(\"class\", \"arc\")\n            .attr(\"d\", function(d) { return path(arc(d)); });\n\n        circles.selectAll(\"circle\")\n            .data(airports)\n            .enter().append(\"svg:circle\")\n            .attr(\"cx\", function(d, i) { return positions[i][0]; })\n            .attr(\"cy\", function(d, i) { return positions[i][1]; })\n            .attr(\"r\", function(d, i) { return Math.sqrt(countByAirport[d.iata]); })\n            .sort(function(a, b) { return countByAirport[b.iata] - countByAirport[a.iata]; });\n      });\n    <\/script>\n  </body>\n</html>\"\"\
